import Axios from 'axios';

export const createDoctors = async (doctors) => {
  const queryDocs = []
  doctors.forEach(async (doctor) => {
    let res = await Axios.get(
      `http://localhost:3000/geocodes/details/${doctor.place_id}`
    );
    const detailedDoctor = res.data.result;
    const {
      formatted_address,
      formatted_phone_number,
      name,
      place_id,
      rating,
      url,
      website,
      user_ratings_total,
      geometry: {
        location: { lat, lng },
      },
    } = detailedDoctor;

    const doctorHash = {
      place_id,
      name,
      formatted_address,
      rating,
      user_ratings_total,
      formatted_phone_number,
      lat,
      lng,
      url,
      website,
    };

    // debugger;
    var myHeaders = new Headers();
    myHeaders.append('Content-Type', 'Application/json');
    myHeaders.append('accepts', 'application/json');
    var requestOptions = {
      method: 'POST',
      headers: myHeaders,
      body: JSON.stringify(doctorHash),
      redirect: 'follow',
    };

    fetch('http://localhost:3000/doctors', requestOptions)
      .then((response) => response.json())
      .then((result) => {        // console.log(result)
        queryDocs.push(result)
        // console.log(queryDocs)
      })
      .catch((error) => console.log('error', error));
  });
  console.log("queryDocs at the end of createDoctors",queryDocs)
};
